import HomePageText from './HomePageSlide/HomePageSlideText';
import ProfilePhoto from '../UtilComponents/ImageComponent';
import HeroSection from '../HeroSection/HeroSection';
import { HomePageSlide } from './HomePageSlide/HomePageSlide';
import './HomePage.css'
import HomePageText1 from './HomePageSlide/HomePageText1';

function HomePage() {
    return (
        <div>
            <HeroSection className="light hero">
                <div className="heroInner">
                    <span>
                        <h1>Will McCudden</h1>
                        {/* <a href="/" className="btn btn-light">
                            Download my CV
                        </a> */}
                    </span>
                </div>
            </HeroSection>

            <HomePageSlide leftWeight={1} rightWeight={3}>
                <ProfilePhoto />
                <p>{HomePageText1}</p>
            </HomePageSlide>
        </div>
    )
}

export default HomePage;
